import React from 'react';
import { Navbar, Container, Nav } from 'react-bootstrap';

const NavbarComponent = () => {
  const scrollToSection = (id) => {
    const element = document.getElementById(id);
    if (element) {
      const yOffset = -window.innerHeight / 2 + element.offsetHeight / 2;
      const y = element.getBoundingClientRect().top + window.pageYOffset + yOffset;

      window.scrollTo({ top: y, behavior: 'smooth' });
    }
  };

  return (
    <Navbar bg="dark" variant="dark" expand="lg" fixed="top">
      <Container>
        <Navbar.Brand onClick={() => scrollToSection('hero')} style={{ cursor: 'pointer' }}>
          Swarnim's Portfolio
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="ms-auto">
            <Nav.Link onClick={() => scrollToSection('hero')}>Home</Nav.Link>
            <Nav.Link onClick={() => scrollToSection('career-objective')}>Career Objective</Nav.Link>
            <Nav.Link onClick={() => scrollToSection('technical-skills')}>Technical Skills</Nav.Link>
            <Nav.Link onClick={() => scrollToSection('education')}>Education</Nav.Link>
            <Nav.Link onClick={() => scrollToSection('professional-development')}>Professional Development</Nav.Link>
            <Nav.Link onClick={() => scrollToSection('work-experience')}>Work Experience</Nav.Link>
            <Nav.Link onClick={() => scrollToSection('references')}>References</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};

export default NavbarComponent;
